import "./Navbar.css";


function Navbar(){
  
  return (
    <nav>
      <div className="content">
        <div className="navbar">
          <div className="nav-logo"></div>
          <div className="nav-links"></div>
        </div>
      </div>
    </nav>
  )
}

export default Navbar;
